import React from 'react';
import ReactDOM from 'react-dom';
import { Routes,Route,BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';


function Home(){
<BrowserRouter>
<Routes>
  <Route exact path="" element={App}></Route>
  </Routes>
</BrowserRouter>
}
ReactDOM.render(
  <React.StrictMode>
    <Home />
  </React.StrictMode>,
  document.getElementById('root')
);
